import styles from "./NavButton.module.css";

const NavButton = (props) => {
  let isBlack = "";
  if (props.black) {
    console.log("BLACK BUTTON!");
    isBlack = "navButtonBlack";
  }

  const className = `${styles.navButton} ${isBlack}`;

  return (
    <div className={className}>
      <div>{props.text}</div>
    </div>
  );
};

export default NavButton;
